import React, { useState } from "react";
import Login from "../Components/Login";

// Pages are good for organizing multiple components together

function Home() {
  return (
    <div className="App">
      style={{
        display: 'flex',
        justifyContent: 'Right',
        alignItems: 'Right',
        height: '100vh'
      }}
      <h1>Environment Tracker</h1>
      <Login/>
    </div>
  );
}

export default Home;
